import React from "react";
export default function TroubleColor() {
  return (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 33 33"><circle cx="16.49997" cy="16.5" r="16.5" fill="#f43434" opacity="0.1"/><polygon points="13.67 7 10.73 16.522 14.372 16.522 12.046 26 22.27 13.801 18.453 13.801 21.085 7 13.67 7" fill="#f43434" stroke="#f43434" stroke-linecap="round" stroke-linejoin="round"/></svg>
  );
}
